import './CaseStudyProjects.css';

function CaseStudyProjects({ projects }) {
  return (
    <div>
      {projects.map((project) => (
        <div key={project.id}>
          <h2>{project.title}</h2>
          {/* Check if subtitle exists before trying to render it */}
          {project.subtitle && <p>{project.subtitle}</p>}
          {/* Other project details */}
        </div>
      ))}
    </div>
  );
}
